                    <MenuItem value={'Vilnius'}>Vilnius</MenuItem>
                    <MenuItem value={'Kaunas'}>Kaunas</MenuItem>
                    <MenuItem value={'30'}>Thirty</MenuItem>
                    </Select>
                </FormControl>
            </div>
        </div>
    );
}

export default Filters;
